import React, { Component } from "react";
import { Map, GoogleApiWrapper, InfoWindow, Marker } from "google-maps-react";
import {raise_admin_bar} from './HomeFunctions';
import {useNavigate} from 'react-router-dom';

const mapStyles = {
  width: "1050px",
  height: "550px",
};

const mapSectionStyles = {
  position: "relative",
  display: "run-in",
  height: "600px",
  width: "1050px",
};



export class MapContainer extends Component {

  state = {
    showingInfoWindow: false,
    activeMarker: {},
    selectedPlace: {},
  };

  onMarkerClick = (props, marker, e) =>
    this.setState({
      selectedPlace: props,
      activeMarker: marker,
      showingInfoWindow: true,
    });

  onClose = (props) => {
    if (this.state.showingInfoWindow) {
      this.setState({
        showingInfoWindow: false,
        activeMarker: null,
      });
    }
  };}


const GoogleMaps = () => {
  const navigate = useNavigate();
  // render() {

    // const navigate = useNavigate();
    return (

      <div>
        <h1>Locations (Please Click on Marker for Address)</h1>
        <div style={mapSectionStyles}>
          <h2>Underground Sbisa</h2>
          <Map
            google={this.props.google}
            zoom={16}
            style={mapStyles}
            initialCenter={{
              lat: 30.61789,
              lng: -96.34385,
            }}
          >
            <Marker
              onClick={this.onMarkerClick}
              name={
                "Underground Sbisa -- 233 Houston St, College Station, TX 77843"
              }
            />
            <InfoWindow
              marker={this.state.activeMarker}
              visible={this.state.showingInfoWindow}
              onClose={this.onClose}
            >
              <div>
                <h4>{this.state.selectedPlace.name}</h4>
              </div>
            </InfoWindow>
          </Map>
        </div>

        <div style={mapSectionStyles}>
          <h2>Polo Road</h2>
          <Map
            google={this.props.google}
            zoom={16}
            style={mapStyles}
            initialCenter={{
              lat: 30.6235,
              lng: -96.33784,
            }}
          >
            <Marker
              onClick={this.onMarkerClick}
              name={
                "Houston Street Subs -- Polo Road -- 322 Polo Rd, College Station, TX 77843"
              }
            />
            <InfoWindow
              marker={this.state.activeMarker}
              visible={this.state.showingInfoWindow}
              onClose={this.onClose}
            >
              <div>
                <h4>{this.state.selectedPlace.name}</h4>
              </div>
            </InfoWindow>
          </Map>
        </div>
        <div style={mapSectionStyles}>
          <h2>West Campus</h2>
          <Map
            google={this.props.google}
            zoom={16}
            style={mapStyles}
            initialCenter={{
              lat: 30.6112,
              lng: -96.34887,
            }}
          >
            <Marker
              onClick={this.onMarkerClick}
              name={
                "Houston Street Subs -- West Campus -- 336 Olsen Blvd Building 1522, College Station, TX 77843"
              }
            />
            <InfoWindow
              marker={this.state.activeMarker}
              visible={this.state.showingInfoWindow}
              onClose={this.onClose}
            >
              <div>
                <h4>{this.state.selectedPlace.name}</h4>
              </div>
            </InfoWindow>
          </Map>
        </div>
        <div class="homebutton" id="admin_panel" onClick={raise_admin_bar}>Admin Panel</div>
            <div class="textbox" id="admin_textbox">Text Box</div>
            {/* <p class="backtest">;{this.state.apiResponse}</p> */}
            <div id="adminpanel">
                <panelbig>ADMIN PANEL</panelbig>
                <img class="admin_button" id="serverlogo" src={require('./components/img/home_transparent.png')} onClick={() => navigate('/')} alt="Home Logo"></img>
                <paneltext>RETURN HOME</paneltext>
                {/* <img class="admin_button" id="reportslogo" src={require('./components/img/reports_transparent.png')}></img> */}
            </div>
      </div>
    );
  }
// }

export default GoogleApiWrapper({
  apiKey: "AIzaSyCrqSeuM6dYiOnJt2vFZ9oRUUnGFrkYVj4",
})(MapContainer);
